ControlPropertyState.AutoRuleBindingString:
Set(MenuSelect,"Business process");
Set(MenuSelect2,If(App.Width > 800, "Process of Private Equity Investment", "PEVC"));
Set(HeaderText,"Investment Portfolio");
Set(isLoading, true);
ClearCollect(investmentPortfolioList, 'TVS->FindAlllInvestmentPortfolio'.Run(resKeyOpenAll.open,resKeyOpenAll.close).listItem);
Set(isLoading, false);
ClearCollect(investmentPorfolioData, []);
ForAll(investmentPortfolioList,
    Collect(investmentPorfolioData, {
        company: ThisRecord.company_name,
        original_investment_cost: {
            total: Text(ThisRecord.total_debt_investment_cost+ThisRecord.total_equity_investment_cost),
            equity: Text(ThisRecord.total_equity_investment_cost),
            debt: Text(ThisRecord.total_debt_investment_cost),
            ownership: Text(ThisRecord.total_percentage_ownership_investment_cost)
        },
        cost_of_divested_portion: {
            total: Text(ThisRecord.total_divested_equity+ThisRecord.total_divested_debt),
            equity: Text(ThisRecord.total_divested_equity),
            debt: Text(ThisRecord.total_divested_debt),
            ownership: Text(ThisRecord.total_divested_percentage_ownership)
        },
        net_equity_debit_investment_cost: {
            total:Text((ThisRecord.total_debt_investment_cost+ThisRecord.total_equity_investment_cost)-(ThisRecord.total_divested_equity+ThisRecord.total_divested_debt)),
            equity: Text(ThisRecord.total_equity_investment_cost-ThisRecord.total_divested_equity),
            debt: Text(ThisRecord.total_debt_investment_cost-ThisRecord.total_divested_debt),
            ownership: Text(ThisRecord.total_percentage_ownership_investment_cost-ThisRecord.total_divested_percentage_ownership)
        }
    })
);

